$_MODULE['<{wkwebp}prestashop>adminwebpconfigurationcontroller_60d3d1a8cf7e9a1350ff3c24f3389e69'] = 'Metadata jsou informace o převedeném obrázku, které budou vloženy do převedeného souboru obrázku, obsahují podrobnosti týkající se samotného obrázku a také informace o jeho výrobě. Žádné nebude doporučeno, protože pouze cwebp podporuje všechny hodnoty. gd vždy odstraní všechna metadata. Zbytek si může buď vše odstranit, nebo si vše ponechat.';
